import styled from "styled-components";
import { Link } from "react-router-dom";
import { Amazon_Logo } from "../assets/Images";

const Header = () => {
  return (
    <HeaderContainer>
      <nav className="TopNav flex">
        <div className="TopNav__left">
          <Link to={"/"} className="TopNav__left__Logo">
            <span>
              <img src={Amazon_Logo} alt="" />
            </span>
          </Link>
        </div>
        <div className="TopNav__middle"></div>
        <div className="TopNav__right"></div>
      </nav>
      <nav className="BottomNav"></nav>
    </HeaderContainer>
  );
};

export default Header;

const HeaderContainer = styled.header`
  width: 100%;
  height: 4rem;
  color: white;
  padding: 1rem;
  background-color: rgba(0, 0, 0, 0.9);

  .TopNav {
    align-items: center;
    .TopNav__left__Logo {
      width: 7rem;
      height: 2.6rem;

      &:hover img {
        border: 2px solid white;
      }

      span {
        width: inherit;
        height: inherit;
        img {
          width: inherit;
          height: inherit;
          border: 2px solid transparent;
          padding: .1rem;
        }
      }
    }
  }
`;
